DROP TABLE IF EXISTS spotify;
CREATE TABLE IF NOT EXISTS spotify(
   artist       VARCHAR(41)
  ,song         VARCHAR(114)
  ,duration_ms  VARCHAR(9)
  ,explicit     VARCHAR(6)
  ,year         VARCHAR(4)
  ,popularity   INTEGER 
  ,danceability VARCHAR(11)
  ,energy       VARCHAR(11)
  ,song_key     VARCHAR(11)
  ,loudness     NUMERIC(7,3)
  ,mode         NUMERIC(6,3)
  ,speechiness  VARCHAR(11)
  ,acousticness VARCHAR(11)
  ,liveness     VARCHAR(11)
  ,valence      VARCHAR(11)
  ,tempo        VARCHAR(11)
  ,genre        VARCHAR(37)
  ,FIELD18      VARCHAR(7)
);
